const tintColorLight = '#fff';
const tintColorDark = '#000';

export default {
  light: {
    text: '#fff',
    background: '#fff',
    tint: tintColorLight,
    tabIconDefault: '#fff',
    tabIconSelected: tintColorLight,
  },
  dark: {
    text: '#1234',
    background: '#000',
    tint: tintColorLight,
    tabIconDefault: '#fff',
    tabIconSelected: tintColorDark,
  },
};
